import React from 'react';
import styled from 'styled-components';

const RecommandListBlock = styled.div`
  width: 22%;
  height: 400px;
  border: 1px solid black;
`;
const RecommandListTitle = styled.div`
  width: 50%;
  background: #73b2ff;
  color: white;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 7px;
  border-radius: 10px;
`;
const RecommandList = () => {
  return (
    <RecommandListBlock>
      <RecommandListTitle>추천 목록</RecommandListTitle>
    </RecommandListBlock>
  );
};

export default RecommandList;
